import './index.scss';
import Navbar from '../Navbar';
import Last from '../../assets/fast-forward.png';
import Skip from '../../assets/skip-track.png';
import { io } from 'socket.io-client';

const socket = io();
socket.on('alert', (msg) => {
    alert(msg);
});

const Homepage = () => {
    return (
        <div className={ 'home' }>
            <Navbar />

            <div className={ 'game-options' }>
                <a>+ Create Game</a>
                <a>+ Join Game</a>
            </div>
        </div>
    );
}

export default Homepage;
